import React from "react";
import { Navbar, NavbarBrand } from "react-bootstrap";
import Logo from "../../assets//IMG_0023.jpg";
const TopNavBar = () => {
  return (
    <Navbar>
      <Nav>
        <NavbarBrand source={Logo} width={150} height={150} />
      </Nav>
    </Navbar>
  );
};

export default TopNavBar;
